import React, { useState, useEffect } from "react";

export default function Services() {
  return (
    <>
      <div className="flex w-full pt-[10px]">
        <img
          src={"attachement/services.png"}
          alt=""
          className="w-full h-full object-cover"
        />
      </div>
      <div>
        <button>
          See more Services!
        </button>
      </div>
    </>
  );
}
